			auto v = std::make_shared<MTPDmessageActionPhoneCall>();
			v->vflags.read(from, end);
			v->vcall_id.read(from, end);
			if (v->has_reason()) { v->vreason.read(from, end); } else { v->vreason = MTPPhoneCallDiscardReason(); }
